import './App.css';
import SiteNavBar from './components/SiteNavBar';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from './pages/Home'

function App() {
    return (
        <>
            <SiteNavBar />
            <BrowserRouter>
            <Routes>

            </Routes>
            <Route path="/" element={<Home />} />
            </BrowserRouter>

        </>
    );
}

export default App;
